import React from 'react';
import Tilt from 'react-tilt';

const Logo = () => {
    return (
        <div className="Tilt">
            <Tilt className="Tilt" options={{max: 25}} style={{width:'150', height:'150'}}>
                <img src="./brain-logo.png" alt="logo"></img>
            </Tilt>
            
        </div>
    )
}

export default Logo;
